with(jqUnit)test("pe.SearchResultEvent.prototype.performer_links_html returns the DOM template for all the performer links",function(){var a=pe.SearchResultEvent.prototype.performer_links_html([{name:"Performer 1",id:"performer_1"},{name:"Performer 2",id:"performer_2"}]);assert_that(a,'<a href="/performers/performer_1" target="_blank" title="See the latest Performer 1 schedule, photos, videos and news.">Performer 1</a>, <a href="/performers/performer_2" target="_blank" title="See the latest Performer 2 schedule, photos, videos and news.">Performer 2</a>')}),
test("pe.SearchResultEvent.prototype.event_performer_label returns an empty string if the performers array is empty",function(){assert_that(pe.SearchResultEvent.prototype.performer_links_html([]),"")});
